/**
 * Enhanced Node Discovery Service
 */
export class EnhancedNodeDiscovery {
  private allNodes: NodeTypeInfo[] = ALL_COMPLETE_NODES;
  
  /**
   * Get all available nodes
   */
  getAllAvailableNodes(): NodeTypeInfo[] {
    return this.allNodes;
  }
  
  /**
   * Search nodes by query
   */
  searchNodes(query: string, options: { limit?: number; maxResults?: number; categories?: string[]; fuzzySearch?: boolean; includeAiOptimized?: boolean } = {}): NodeTypeInfo[] {
    const queryLower = query.toLowerCase();
    let results = this.allNodes.filter(node =>
      node.name.toLowerCase().includes(queryLower) ||
      node.displayName.toLowerCase().includes(queryLower) ||
      node.description.toLowerCase().includes(queryLower) ||
      (node.category && node.category.toLowerCase().includes(queryLower))
    );
    
    // Filter by categories if specified
    if (options.categories && options.categories.length > 0) {
      results = results.filter(node => 
        options.categories!.some(cat => 
          node.category?.toLowerCase().includes(cat.toLowerCase())
        )
      );
    }
    
    const maxResults = options.maxResults || options.limit || 50;
    return results.slice(0, maxResults);
  }
  
  /**
   * Get nodes by category
   */
  getNodesByCategory(category: string): NodeTypeInfo[] {
    return this.allNodes.filter(node =>
      node.category === category ||
      node.subcategory === category ||
      (node.category && node.category.toLowerCase().includes(category.toLowerCase()))
    );
  }
  
  /**
   * Get node statistics
   */
  getNodeStatistics() {
    const categories = new Set(this.allNodes.map(node => node.category).filter(Boolean));
    const aiNodes = this.allNodes.filter(node => 
      node.category?.toLowerCase().includes('ai') || 
      node.name.toLowerCase().includes('ai') ||
      node.name.toLowerCase().includes('openai') ||
      node.name.toLowerCase().includes('claude') ||
      node.name.toLowerCase().includes('anthropic')
    );
    return {
      totalNodes: this.allNodes.length,
      categories: categories.size,
      categoryList: Array.from(categories),
      aiNodes: aiNodes.length,
      regularNodes: this.allNodes.length - aiNodes.length,
      topIntegrations: Array.from(categories).slice(0, 10),
      coverage: this.allNodes.length > 500 ? 'Complete' : 'Partial'
    };
  }
  
  /**
   * Get node categories
   */
  getNodeCategories(): string[] {
    return Array.from(new Set(this.allNodes.map(node => node.category).filter(Boolean)));
  }
  
  /**
   * Discover by category - alias for getNodesByCategory
   */
  discoverByCategory(category: string): NodeTypeInfo[] {
    return this.getNodesByCategory(category);
  }
  
  /**
   * Discover by intent - intelligent search based on user intent
   */
  discoverByIntent(intent: string | any): NodeTypeInfo[] {
    let searchTerm: string;
    
    if (typeof intent === 'string') {
      searchTerm = intent;
    } else if (typeof intent === 'object' && intent.intent) {
      searchTerm = intent.intent;
    } else {
      searchTerm = String(intent);
    }
    
    const intentLower = searchTerm.toLowerCase();
    return this.allNodes.filter(node => {
      const searchText = `${node.name} ${node.displayName} ${node.description} ${node.category}`.toLowerCase();
      return searchText.includes(intentLower) ||
             this.matchIntent(searchTerm, node);
    }).slice(0, 20);
  }
  
  /**
   * Get AI ecosystem nodes
   */
  getAiEcosystem(): any {
    const aiNodes = this.allNodes.filter(node => 
      node.category?.toLowerCase().includes('ai') || 
      node.name.toLowerCase().includes('ai') ||
      node.name.toLowerCase().includes('openai') ||
      node.name.toLowerCase().includes('claude') ||
      node.name.toLowerCase().includes('anthropic') ||
      node.name.toLowerCase().includes('langchain')
    );

    return {
      all: aiNodes,
      chatModels: aiNodes.filter(node => 
        node.name.toLowerCase().includes('chat') || 
        node.name.toLowerCase().includes('model')
      ),
      vectorStores: aiNodes.filter(node => 
        node.name.toLowerCase().includes('vector') || 
        node.name.toLowerCase().includes('store')
      ),
      embeddings: aiNodes.filter(node => 
        node.name.toLowerCase().includes('embedding')
      ),
      agents: aiNodes.filter(node => 
        node.name.toLowerCase().includes('agent')
      )
    };
  }
  
  /**
   * Get platform integrations
   */
  getPlatformIntegrations(): any {
    const communicationNodes = this.allNodes.filter(node => 
      ['slack', 'discord', 'telegram', 'teams', 'chat', 'email'].some(comm => 
        node.name.toLowerCase().includes(comm)
      )
    );
    
    const databaseNodes = this.allNodes.filter(node => 
      ['postgres', 'mysql', 'mongodb', 'redis', 'database', 'sql'].some(db => 
        node.name.toLowerCase().includes(db)
      )
    );
    
    const cloudNodes = this.allNodes.filter(node => 
      ['aws', 'azure', 'google', 'cloud', 's3', 'lambda'].some(cloud => 
        node.name.toLowerCase().includes(cloud)
      )
    );
    
    const businessNodes = this.allNodes.filter(node => 
      ['salesforce', 'hubspot', 'shopify', 'stripe', 'paypal', 'crm'].some(business => 
        node.name.toLowerCase().includes(business)
      )
    );

    return {
      all: [...communicationNodes, ...databaseNodes, ...cloudNodes, ...businessNodes],
      communication: communicationNodes,
      databases: databaseNodes,
      cloud: cloudNodes,
      business: businessNodes
    };
  }
  
  /**
   * Get node chain suggestions
   */
  getNodeChainSuggestions(nodeType: string): NodeTypeInfo[] {
    // Return complementary nodes based on the input node type
    const node = this.allNodes.find(n => n.name === nodeType);
    if (!node) return [];
    
    // Find related nodes in same category
    return this.getNodesByCategory(node.category || '').slice(0, 5);
  }
  
  /**
   * Match intent with node
   */
  private matchIntent(intent: string, node: NodeTypeInfo): boolean {
    const intentWords = intent.toLowerCase().split(' ');
    const nodeText = `${node.name} ${node.displayName} ${node.description}`.toLowerCase();
    
    return intentWords.some(word => nodeText.includes(word));
  }
}

// Create singleton instance
export const enhancedNodeDiscovery = new EnhancedNodeDiscovery();

// Export utility functions
export const getAllAvailableNodes = () => enhancedNodeDiscovery.getAllAvailableNodes();
export const searchNodes = (query: string, options?: { limit?: number; maxResults?: number; categories?: string[]; fuzzySearch?: boolean; includeAiOptimized?: boolean }) => 
  enhancedNodeDiscovery.searchNodes(query, options);
export const getNodesByCategory = (category: string) => 
  enhancedNodeDiscovery.getNodesByCategory(category);
export const getNodeStatistics = () => enhancedNodeDiscovery.getNodeStatistics();
export const getNodeCategories = () => enhancedNodeDiscovery.getNodeCategories();
export const discoverByCategory = (category: string) => enhancedNodeDiscovery.discoverByCategory(category);
export const discoverByIntent = (intent: string | any) => enhancedNodeDiscovery.discoverByIntent(intent);
export const getAiEcosystem = () => enhancedNodeDiscovery.getAiEcosystem();
export const getPlatformIntegrations = () => enhancedNodeDiscovery.getPlatformIntegrations();
export const getNodeChainSuggestions = (nodeType: string) => enhancedNodeDiscovery.getNodeChainSuggestions(nodeType);

// Universal catalog for compatibility
export const universalNodeCatalog = {
  getAllAvailableNodes,
  searchNodes,
  getNodesByCategory,
  getNodeStatistics,
  getNodeCategories,
  discoverByCategory,
  discoverByIntent,
  getAiEcosystem,
  getPlatformIntegrations,
  getNodeChainSuggestions
};

export default enhancedNodeDiscovery;
